const block1 = (item, index, context) => { return html`<slot name="${ifDefined(item._individualSlot)}"></slot>`; };
const block2 = (context) => { return html`<span @click="${context._openOverflowPopover}" class="ui5-tokenizer-more-text">${ifDefined(context._nMoreText)}</span>`; };


